import React, { useState } from 'react';
import axios from 'axios';

const API_BASE = 'http://localhost:3001';

function App() {
  const [token, setToken] = useState(localStorage.getItem('token'));
  const [user, setUser] = useState(null);
  const [providers, setProviders] = useState([]);
  const [bookings, setBookings] = useState([]);
  const [slots, setSlots] = useState([]);

  const login = async (email, password) => {
    try {
      const response = await axios.post(`${API_BASE}/auth/login`, { email, password });
      setToken(response.data.accessToken);
      setUser(response.data.user);
      localStorage.setItem('token', response.data.accessToken);
    } catch (error) {
      alert('Login failed: ' + error.response?.data?.message);
    }
  };

  const searchProviders = async () => {
    try {
      const response = await axios.get(`${API_BASE}/providers/search?specialty=cardiology`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setProviders(response.data);
    } catch (error) {
      alert('Search failed: ' + error.response?.data?.message);
    }
  };

  const getSlots = async (serviceId) => {
    try {
      const response = await axios.get(`${API_BASE}/providers/${serviceId}/slots?start=2025-08-26T00:00:00Z&end=2025-09-02T23:59:59Z`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setSlots(response.data);
    } catch (error) {
      alert('Failed to get slots: ' + error.response?.data?.message);
    }
  };

  const createBooking = async (clinicId, serviceId, slotId) => {
    try {
      await axios.post(`${API_BASE}/bookings`, {
        clinicId, serviceId, slotId, notes: 'Web booking'
      }, {
        headers: { Authorization: `Bearer ${token}` }
      });
      alert('Booking created successfully!');
      getBookings();
    } catch (error) {
      alert('Booking failed: ' + error.response?.data?.message);
    }
  };

  const getBookings = async () => {
    try {
      const response = await axios.get(`${API_BASE}/bookings/my`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setBookings(response.data);
    } catch (error) {
      alert('Failed to get bookings: ' + error.response?.data?.message);
    }
  };

  if (!token) {
    return (
      <div style={{ padding: '20px', maxWidth: '400px', margin: '50px auto' }}>
        <h1>🏥 Healthcare Platform</h1>
        <div style={{ marginBottom: '20px' }}>
          <h3>Demo Login</h3>
          <button onClick={() => login('patient@healthcare.com', 'Patient123!')} 
                  style={{ margin: '5px', padding: '10px', backgroundColor: '#007bff', color: 'white', border: 'none', borderRadius: '5px' }}>
            Login as Patient
          </button>
          <button onClick={() => login('doctor@healthcare.com', 'Provider123!')} 
                  style={{ margin: '5px', padding: '10px', backgroundColor: '#28a745', color: 'white', border: 'none', borderRadius: '5px' }}>
            Login as Doctor
          </button>
          <button onClick={() => login('admin@healthcare.com', 'Admin123!')} 
                  style={{ margin: '5px', padding: '10px', backgroundColor: '#dc3545', color: 'white', border: 'none', borderRadius: '5px' }}>
            Login as Admin
          </button>
        </div>
      </div>
    );
  }

  return (
    <div style={{ padding: '20px', maxWidth: '1200px', margin: '0 auto' }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '30px' }}>
        <h1>🏥 Healthcare Platform</h1>
        <div>
          <span>Welcome, {user?.patient?.firstName || user?.email} ({user?.role})</span>
          <button onClick={() => { setToken(null); localStorage.removeItem('token'); }} 
                  style={{ marginLeft: '10px', padding: '5px 10px', backgroundColor: '#dc3545', color: 'white', border: 'none', borderRadius: '3px' }}>
            Logout
          </button>
        </div>
      </div>

      <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
        <div>
          <h2>🔍 Search Providers</h2>
          <button onClick={searchProviders} 
                  style={{ padding: '10px 20px', backgroundColor: '#007bff', color: 'white', border: 'none', borderRadius: '5px', marginBottom: '15px' }}>
            Search Cardiology
          </button>

          {providers.map(provider => (
            <div key={provider.id} style={{ border: '1px solid #ddd', padding: '15px', marginBottom: '10px', borderRadius: '5px' }}>
              <h3>{provider.name}</h3>
              <p>📍 {provider.address}</p>
              <p>📞 {provider.phone}</p>
              <p><strong>{provider.providerOrg.name}</strong> ({provider.providerOrg.type})</p>

              <h4>Services:</h4>
              {provider.services.map(service => (
                <div key={service.id} style={{ marginLeft: '10px', marginBottom: '10px' }}>
                  <p><strong>{service.name}</strong> - ${service.price}</p>
                  <p>{service.description}</p>
                  <button onClick={() => getSlots(service.id)} 
                          style={{ padding: '5px 10px', backgroundColor: '#28a745', color: 'white', border: 'none', borderRadius: '3px', marginRight: '5px' }}>
                    View Slots
                  </button>
                </div>
              ))}
            </div>
          ))}
        </div>

        <div>
          <h2>📅 Available Slots</h2>
          {slots.slice(0, 10).map(slot => (
            <div key={slot.id} style={{ border: '1px solid #ddd', padding: '10px', marginBottom: '5px', borderRadius: '3px' }}>
              <p><strong>{slot.service.name}</strong></p>
              <p>🕐 {new Date(slot.startTime).toLocaleString()}</p>
              <p>📍 {slot.clinic.name}</p>
              <button onClick={() => createBooking(slot.clinicId, slot.serviceId, slot.id)} 
                      style={{ padding: '5px 10px', backgroundColor: '#007bff', color: 'white', border: 'none', borderRadius: '3px' }}>
                Book Now
              </button>
            </div>
          ))}

          <h2>📋 My Bookings</h2>
          <button onClick={getBookings} 
                  style={{ padding: '10px 20px', backgroundColor: '#6c757d', color: 'white', border: 'none', borderRadius: '5px', marginBottom: '15px' }}>
            Refresh Bookings
          </button>

          {bookings.map(booking => (
            <div key={booking.id} style={{ border: '1px solid #ddd', padding: '15px', marginBottom: '10px', borderRadius: '5px' }}>
              <h4>{booking.service.name}</h4>
              <p>Status: <span style={{ color: booking.status === 'CANCELLED' ? 'red' : 'green' }}>{booking.status}</span></p>
              <p>🕐 {new Date(booking.slot.startTime).toLocaleString()}</p>
              <p>📍 {booking.clinic.name}</p>
              <p>💰 ${booking.service.price}</p>
              <p>📝 {booking.notes}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default App;
